import React from 'react';
import './App.css';

function Navbar() {
  return (
    <nav >
        <h3>Logo</h3>
        <ul className='nav-links'>
            <li>Shop</li>
            <li>About</li>
        </ul>
    </nav>
  );
}

export default Navbar;
